const l=JSON.parse('{"key":"v-2c32edd6","path":"/posts/notes/miad_notes.html","title":"移动互联网应用开发 课程笔记","lang":"zh-CN","frontmatter":{"article":true,"author":"Neonscape","date":"2025-01-09T00:00:00.000Z","image":"/assets/imgs/202412/202412_5.png","cover":"/assets/imgs/202412/202412_6.png","category":["notes"],"tag":["MIAD"]},"headers":[{"level":2,"title":"一 HarmonyOS的特色、原理和技术","slug":"一-harmonyos的特色、原理和技术","link":"#一-harmonyos的特色、原理和技术","children":[{"level":3,"title":"1.1 特色","slug":"_1-1-特色","link":"#_1-1-特色","children":[]},{"level":3,"title":"1.2 原理","slug":"_1-2-原理","link":"#_1-2-原理","children":[]},{"level":3,"title":"1.3 特性","slug":"_1-3-特性","link":"#_1-3-特性","children":[]}]}],"git":{"createdTime":1736529714000,"updatedTime":1736529714000,"contributors":[{"name":"Neonscape","email":"neonscapemail@gmail.com","commits":1}]},"readingTime":{"minutes":0.9,"words":269},"filePathRelative":"posts/notes/miad_notes.md","localizedDate":"2025年1月9日","excerpt":"<h1> 移动互联网应用开发 课程笔记</h1>\\n<!--more-->\\n<!--这课真的不是来打广告的吗...-->\\n<h2> 一 HarmonyOS的特色、原理和技术</h2>\\n<h3> 1.1 特色</h3>\\n<ul>\\n<li>同一套系统能力，适配多种终端形态；</li>\\n<li>支持多设备互联；</li>\\n<li>一次开发，多端部署</li>\\n</ul>\\n<h3> 1.2 原理</h3>\\n<p>系统采用分层结构：内核层、系统服务层、框架层和应用层。</p>\\n<ul>\\n<li>内核层\\n<ul>\\n<li>分为内核子系统和驱动子系统</li>\\n<li>支持多种操作系统</li>\\n</ul>\\n</li>\\n<li>系统服务层\\n<ul>\\n<li>核心能力集合</li>\\n<li>系统基础能力子系统</li>\\n<li>基础软件服务子系统</li>\\n<li>增强软件服务子系统</li>\\n<li>硬件服务子系统</li>\\n</ul>\\n</li>\\n<li>框架层\\n<ul>\\n<li>提供了用户语言框架，Ability框架和UI框架。</li>\\n</ul>\\n</li>\\n<li>应用层\\n<ul>\\n<li>包括系统应用和第三方应用。</li>\\n</ul>\\n</li>\\n</ul>"}');export{l as data};
